import './App.css';
import React, { Component } from 'react';

class App extends Component {
  state = { dots: [{color: "blue", x: 0, y: 0}, {color: "red", x: 0, y: 0}] }
  render() { 
    return (
      <div>
        <img src="https://i.redd.it/ldfi6xzs56t51.png" width="80%" height="auto" />

        <img src="https://upload.wikimedia.org/wikipedia/commons/0/0e/Basic_blue_dot.png" width="15px" height="15px" style={{position: "absolute", left: "0px"}}/>
      </div>
    )
  }
}

export default App;
